import React, { Component } from "react";
import { getRandomHeaderLine } from "../helper";
import Canvas from "./canvas/Canvas";
import CanvasObj from "./canvas/CanvasObj";

import Navigation from "./Navigation";

class App extends Component {

  changeModel =(e)=>{
    console.log(e.target.value)
  }




  render() {
    return (
      <div>
        <Navigation />
        {/* <Canvas tagline={getRandomHeaderLine(0)} /> */}
        <div className="container-fluid">
          <div className="row">
            <div className="col-9">
              <CanvasObj />
            </div>
            <div className="col-2 mx-auto mt-4">
              <div className="card ">
                <div className="card-title text-center p-2">Icons</div>
                <input
                  className="btn btn-info m-1"
                  name="dummy"
                  value="Dummy"
                  onClick={this.changeModel}
                />
                <input className="btn btn-info m-1" name="cube" value="Cube" 
                onClick={this.changeModel}/>
                <input
                  className="btn btn-info m-1"
                  name="sphere"
                  value="Sphere"
                  onClick={this.changeModel}
                />
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
